    fontSize:20,
    // You might want to set a specific font size or weight
  },
  signUpGoogleButton: {
    backgroundColor: 'white',
    padding: 1,
    borderRadius: 5,
    borderWidth: 2,
    borderColor: 'white',
    width: 150,
    top: 10,
  },
  container2:{
    flex: 1,
